import React, { useState, useEffect } from 'react';
import Target from '../../assets/images/target.svg';
import FreshStart from '../../assets/images/achievement-first-time-user.svg';
import MilestoneMastered from '../../assets/images/achievement-milestone-masterted.svg';
import BeyondBasics from '../../assets/images/achievement-beyond-basics.svg';
import ChallengeAccepted from '../../assets/images/achievement-challenge-accepted.svg';
import Mastermind from '../../assets/images/achievement-mastermind.svg';
import DashboardNav from './UserDashboardNav';
import awardsData from '../../data/awards.json';

function Challenges() {
    const [userAchievements, setUserAchievements] = useState([]);

    useEffect(() => {
        // Fetch user achievements from database (replace with your actual logic)
        const fetchAchievements = async () => {
            const token = localStorage.getItem('authToken');
            const response = await fetch(`/api/user-data`, {
                headers: {
                  'Authorization': `Bearer ${token}`
                }
            });      
            const data = await response.json();
            if (data.success) {
                setUserAchievements(data.user.achievements || []);
                console.log(data.user.achievements);
            } else {
                console.error('Error fetching user data:', data.message);
            }
        };
        fetchAchievements();
    }, []);

    return (
        <main className='flex flex-row relative'>
            <DashboardNav />
            <section className='px-10 py-10 ms-64 w-2/3'>
                <div className="bg-primary w-full rounded-lg p-6 mt-7 flex justify-between items-center">
                    <div>
                        <h1 className="text-3xl font-bold text-white">Conquer Challenges, Earn Rewards!</h1>
                        <p className="text-blue-50 mt-3 me-2">Test your skills and unlock exciting badges with our diverse challenges. Daily, weekly, themed, and milestone-based, there's something for everyone. Track progress, earn rewards, and compete with the community (optional). Dive in and see what you can achieve!</p>
                    </div>
                    <img src={Target} alt="target" className="h-40"/>
                </div>
                <ul>
                    <li><h2 className="text-2xl font-bold mt-10 border-b-2 pb-2">Unlocked Achivements</h2></li>
                    {userAchievements.length > 0 && (
                        <>
                            {Object.entries(awardsData).map(([key, award]) => (
                            userAchievements.includes(award.name) && (
                                <li key={key} className="mt-4 flex gap-8 items-center">
                                <img src={`https://wordpress.stackexchange.com/questions/152703/how-to-get-relative-url-of-medium-sized-featured-image`} alt={award.name} className="h-28" />
                                <div>
                                    <h1 className="text-xl font-bold">{award.name}</h1>
                                    <p className="text-gray-600 mt-2">{award.description}</p>
                                </div>
                                </li>
                            )
                            ))}
                        </>
                    )}                    
                    <li><h2 className="text-2xl font-bold mt-10 border-b-2 pb-2">Locked Achivements</h2></li>
                    {/* <li className="mt-4 flex gap-8 items-center">
                        <img src={MilestoneMastered} alt="target" className="h-28"/>
                        <div>
                            <h1 className="text-xl font-bold">Milestone Mastered</h1>
                            <p className="text-gray-600 mt-2">Complete a significant action within the platform.</p>
                            <div className="flex items-center mt-3 gap-2">
                                <div className="w-80 bg-gray-200 rounded-full h-4">
                                    <div className="bg-secondary h-4 rounded-full inline-block"></div>
                                </div>
                                <span>1/1</span>
                            </div>
                        </div>
                    </li> */}

                    <li className="mt-4 flex gap-8 items-center">
                        <img src={BeyondBasics} alt="target" className="h-28"/>
                        <div>
                            <h1 className="text-xl font-bold">Beyond Basics</h1>
                            <p className="text-gray-600 mt-2">Complete all 10 stages in easy level.</p>
                            <div className="flex items-center mt-3 gap-2">
                                <div className="w-80 bg-gray-200 rounded-full h-4">
                                    <div className="bg-secondary h-4 rounded-full inline-block"></div>
                                </div>
                                <span>0/10</span>
                            </div>
                    </div>
                    </li>
                    <li className="mt-4 flex gap-8 items-center">
                        <img src={ChallengeAccepted} alt="target" className="h-28"/>
                        <div>
                            <h1 className="text-xl font-bold">Challenge Accepted</h1>
                            <p className="text-gray-600 mt-2">Complete all 10 stages in moderate level.</p>
                            <div className="flex items-center mt-3 gap-2">
                                <div className="w-80 bg-gray-200 rounded-full h-4">
                                    <div className="bg-secondary h-4 rounded-full inline-block"></div>
                                </div>
                                <span>0/10</span>
                            </div>
                    </div>
                    </li>
                    <li className="mt-4 flex gap-8 items-center">
                        <img src={Mastermind} alt="target" className="h-28"/>
                        <div>
                            <h1 className="text-xl font-bold">Mastermind</h1>
                            <p className="text-gray-600 mt-2">Complete all stages.</p>
                            <div className="flex items-center mt-3 gap-2">
                                <div className="w-80 bg-gray-200 rounded-full h-4">
                                    <div className="bg-secondary h-4 rounded-full inline-block"></div>
                                </div>
                                <span>0/30</span>
                            </div>
                    </div>
                    </li>
                </ul>
            </section>
        </main>
    );
}

export default Challenges;
